const opt = {
  match: {
    kind: 'bracketIncludeMulti',
    path: './fixtures/'
  },
  comment: {
    type: 'singleAsterisk'
  },
  text: {
    indent: true
  },
  fence: 'strict'
};
const results = bp.buildInclude('','./src/interfaces.ts', opt);
````

